def save_crops_to_primary_csv(crops, filename):
    with open(filename, 'w', newline='') as file:
        writer = csv.writer(file)
        
        # Write the header
        writer.writerow(['Crop', 'MinPH', 'MaxPH', 'MinTemp', 'MaxTemp', 'MinRain', 'MaxRain', 
                         'MinHumidity', 'MaxHumidity', 'MinN', 'MaxN', 'MinP', 'MaxP', 'MinK', 'MaxK'])
        
        # Write the crop data
        for crop, data in crops.items():
            writer.writerow([
                crop,
                data['ph'][0], data['ph'][1],
                data['temp'][0], data['temp'][1],
                data['rainfall'][0], data['rainfall'][1],
                data['humidity'][0], data['humidity'][1],
                data['n'][0], data['n'][1],
                data['p'][0], data['p'][1],
                data['k'][0], data['k'][1]
            ])

# Usage
save_crops_to_primary_csv(crops, 'primary.csv')

